import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const combine = `
const combine = function (n, k) {
  const result = []
  const aux = (index = 1, current = []) => {
    if (current.length === k) {
      result.push(current)
      return
    }
    if (index > n) {
      return
    }
    aux(index + 1, [...current, index])
    aux(index + 1, current)
  }
  aux()
  return result
}

console.log(combine(4,2))`.trim();

const sortedArrayToBST = `
const sortedArrayToBST = (nums = []) => {
  const aux = (low, high) => {
    if (low <= high) {
      const middle = Math.floor((low + high) / 2)
      const node = {
        val: nums[middle],
      }
      node.left = aux(low, middle - 1)
      node.right = aux(middle + 1, high)
      return node
    }
    return null
  }
  return aux(0, nums.length - 1)
}

console.log(sortedArrayToBST([-10,-3,0,5,9]))`.trim();

const maxProfit = `
const maxProfit = function (prices) {
  let max = 0
  let minPrice = Infinity
  for (const price of prices) {
    minPrice = Math.min(price, minPrice)
    max = Math.max(max, price - minPrice)
  }
  return max
}

console.log(maxProfit([7,1,5,3,6,4]))`.trim();

const isPalindrome = `
const isPalindrome = function (s) {
  let newS = ''
  for (const c of s) {
    if (/[a-zA-Z0-9]/.test(c)) {
      newS += c.toLowerCase()
    }
  }
  for (let i = 0; i < Math.floor(newS.length / 2); i++) {
    if (newS[i] !== newS[newS.length - 1 - i]) {
      return false
    }
  }
  return true
}

console.log(isPalindrome("A man, a plan, a canal: Panama"))`.trim();

const ladderLength = `

const ladderLength = function (beginWord, endWord = '', wordList = []) {
  const distance = (a = '', b = '') => {
    let count = 0
    for (let index = 0; index < b.length; index++) {
      if (a[index] !== b[index]) {
        count += 1
      }
    }
    return count === 1
  }
  let current = [beginWord]
  const visited = {
  }
  let count = 1
  while (current.length > 0) {
    const next = []
    for (const word of current) {
      if (word === endWord) {
        return count
      }
      if (!visited[word]) {
        next.push(...wordList.filter(word2 => distance(word, word2) && !visited[word2]))
      }
      visited[word] = true
    }
    count += 1
    current = next
  }
  return 0
}

console.log(ladderLength("hit", "cog", ["hot","dot","dog","lot","log","cog"]))`.trim();

const partition = `
const partition = (s = '') => {
  const isPalindrome = (left, right) => {
    if (left === right) {
      return true
    }
    for (let i = left; i <= right; i++) {
      if (s[i] !== s[right - i + left]) {
        return false
      }
    }
    return true
  }
  const result = []
  const aux = (index = 0, current = []) => {
    if (index === s.length) {
      result.push(current)
    }
    for (let i = index; i < s.length; i++) {
      if (isPalindrome(index, i)) {
        aux(i + 1, [...current, s.substring(index, i + 1)])
      }
    }
  }
  aux()
  return result
}

console.log(partition("aab"))`.trim();

const wordBreak = `
const wordBreak = (s, wordDict = []) => {
  const memo = {}
  const aux = (current = '') => {
    if (memo[current] !== undefined) {
      return memo[current]
    }
    if (current === s) {
      return true
    }
    if (s.indexOf(current) === -1) {
      return false
    }
    memo[current] = wordDict.some(word => aux(current + word))
    return memo[current]
  }
  return aux('')
}

console.log(wordBreak("leetcode", wordDict = ["leet", "code"]))`.trim();

const maxProduct = `
const maxProduct = (nums = []) => {
  if (nums.length === 0) {
    return 0
  }
  let prevMax = nums[0]
  let prevMin = nums[0]
  let max = nums[0]
  for (let i = 1; i < nums.length; i++) {
    const currentMax = Math.max(nums[i], prevMax * nums[i], prevMin * nums[i])
    const currentMin = Math.min(nums[i], prevMax * nums[i], prevMin * nums[i])
    prevMax = currentMax
    prevMin = currentMin
    if (prevMax > max) {
      max = prevMax
    }
  }
  return max
}


console.log(maxProduct([2,3,-2,4]))`.trim();

const findMissingRanges = `
const findMissingRanges = function (nums, lower, upper) {
  const result = []
  const count = (lo, hi) => hi - lo - 1
  const set = (lo, hi) => {
    if (count(lo, hi) === 1) {
      result.push('$'{lo + 1}')
    } else if (count(lo, hi) > 1) {
      result.push('$'{lo + 1}->'$'{hi - 1}')
    }
  }
  for (let i = 0; i <= nums.length; i++) {
    set(
      i === 0 ? lower - 1 : nums[i - 1],
      i === nums.length ? upper + 1 : nums[i],
    )
  }
  return result
}


console.log(findMissingRanges([1,2,3,-2,4]))`.trim();

const maximumGap = `
const maximumGap = function (nums = []) {
  const maxValue = Math.max(...nums)
  const countingSort = (place) => {
    const count = []
    nums.forEach((num) => {
      const index = Math.floor(num / place) % 10
      count[index] = count[index] || []
      count[index].push(num)
    })
    return count.reduce((acc, v) => {
      if (v !== undefined) {
        acc = acc.concat(v)
      }
      return acc
    }, [])
  }

  let place = 1
  while (Math.floor(maxValue / place) > 0) {
    nums = countingSort(place)
    place *= 10
  }
  let max = 0
  for (let i = 1; i < nums.length; i++) {
    max = Math.max(max, nums[i] - nums[i - 1])
  }
  return max
}


console.log(maximumGap([3,6,9,1]))`.trim();


class DSLogic6 extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0)
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4><Sidebar /></h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
              <h3>1. Combinations</h3>
              Given two integers n and k, return all possible combinations of k numbers out of 1 ... n.
              <br/>
You may return the answer in any order.<br/><br/>
Example 1:<br/>

Input: n = 4, k = 2<br/>
Output:
[<br/>
  [2,4],<br/>
  [3,4],<br/>
  [2,3],<br/>
  [1,2],<br/>
  [1,3],<br/>
  [1,4],<br/>
]<br/><br/>
Example 2:<br/>

Input: n = 1, k = 1<br/>
Output: [[1]]
              <div style={titles}>
                <PrismCode
                  code={combine}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>2. Convert Sorted Array to Binary Search Tree.</h3>
              Given an array where elements are sorted in ascending order, convert it to a height balanced BST.
              <br/>
For this problem, a height-balanced binary tree is defined as a binary tree in which the depth of the two subtrees of every node never differ by more than 1.
<br/><br/>
Given the sorted array: [-10,-3,0,5,9]<br/>
One possible answer is: [0,-3,9,-10,null,5]
              <div style={titles}>
                <PrismCode
                  code={sortedArrayToBST}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>3. Best Time to Buy and Sell Stock.</h3>
              Say you have an array for which the ith element is the price of a given stock on day i.
              <br/>
If you were only permitted to complete at most one transaction (i.e., buy one and sell one share of the stock), design an algorithm to find the maximum profit.
<br/>
Note that you cannot sell a stock before you buy one.<br/><br/>
Input: [7,1,5,3,6,4]<br/>
Output: 5<br/>
Explanation: Buy on day 2 (price = 1) and sell on day 5 (price = 6), profit = 6-1 = 5.
             Not 7-1 = 6, as selling price needs to be larger than buying price.
              <div style={titles}>
                <PrismCode
                  code={maxProfit}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>4. Valid Palindrome.</h3>
              Given a string, determine if it is a palindrome, considering only alphanumeric characters and ignoring cases.
              <br/>
Note: For the purpose of this problem, we define empty string as valid palindrome.
<br/><br/>
Example 1:<br/>

Input: "A man, a plan, a canal: Panama"<br/>
Output: true<br/><br/>
Example 2:<br/>

Input: "race a car"<br/>
Output: false
              <div style={titles}>
                <PrismCode
                  code={isPalindrome}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>5. Word Ladder.</h3>
              Given two words (beginWord and endWord), and a dictionary's word list, find the length of shortest transformation sequence from beginWord to endWord, such that:
              <br/><br/>
              <ul>
                <li>Only one letter can be changed at a time.</li>
                <li>Each transformed word must exist in the word list.</li>
              </ul>
              <br/>
<b>Note: </b>
<ul>
  <li>Return 0 if there is no such transformation sequence.</li>
  <li>All words have the same length.</li>
  <li>All words contain only lowercase alphabetic characters.</li>
  <li>You may assume no duplicates in the word list.</li>
  <li>You may assume beginWord and endWord are non-empty and are not the same.</li>
</ul>
<br/>
Example 1:
<br/>
Input:<br/>
beginWord = "hit",<br/>
endWord = "cog",<br/>
wordList = ["hot","dot","dog","lot","log","cog"]<br/>
Output: 5
<br/><br/>

Explanation: As one shortest transformation is "hit" - "hot" - "dot" - "dog" - "cog",
return its length 5.
              <div style={titles}>
                <PrismCode
                  code={ladderLength}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>6. Palindrome Partitioning.</h3>
              Input: "aab"<br/><br/>
Output:
[<br/>
  ["aa","b"],<br/>
  ["a","a","b"]
]
              <div style={titles}>
                <PrismCode
                  code={partition}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>7. Word Break.</h3>
              Given a non-empty string s and a dictionary wordDict containing a list of non-empty words, determine if s can be segmented into a space-separated sequence of one or more dictionary words.
              <br/>
              <br/>
              <b>Note: </b>
              <ul>
                <li>The same word in the dictionary may be reused multiple times in the segmentation.</li>
                <li>You may assume the dictionary does not contain duplicate words.</li>
              </ul>
              <br/>
              Input: s = "leetcode", wordDict = ["leet", "code"]<br/>
Output: true<br/>
Explanation: Return true because "leetcode" can be segmented as "leet code".
              <div style={titles}>
                <PrismCode
                  code={wordBreak}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>8. Maximum Product Subarray.</h3>
              Given an integer array nums, find the contiguous subarray within an array (containing at least one number) which has the largest product.
              <br/>
              Input: [2,3,-2,4]<br/>
Output: 6
              <div style={titles}>
                <PrismCode
                  code={maxProduct}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>9. Missing Ranges.</h3>
              <div style={titles}>
                <PrismCode
                  code={findMissingRanges}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>10. Maximum Gap.</h3>

              <div style={titles}>
                <PrismCode
                  code={maximumGap}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    )
  }
}

export default (withStyles(styles)(DSLogic6));
